import React from 'react';
import logo from './../assets/logo_.jpeg';
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';
import { faHouse } from '@fortawesome/free-solid-svg-icons';
import { faNewspaper } from '@fortawesome/free-solid-svg-icons';
import { faCartShopping } from '@fortawesome/free-solid-svg-icons';
import { faTruck } from '@fortawesome/free-solid-svg-icons';
import { faMessage } from '@fortawesome/free-solid-svg-icons';
import { faUser} from '@fortawesome/free-solid-svg-icons';

const Navbar = () => {
    return (

               <header className='nav'>
               <h1><img src={logo} alt="" className='logo' /> Foodify.</h1>
                       <ul className='d-flex'>
                           <li>  <h1 className='h1'><FontAwesomeIcon icon={faHouse} className='i'/> </h1></li>
                           <li> <h1 className='h1'> <FontAwesomeIcon icon={faNewspaper} className='i'/> Nouveautés</h1></li>
                           <li>  <h1 className='h1'><FontAwesomeIcon icon={faNewspaper} className='i'/> Catégories</h1></li>
                           <li> <h1 className='h1'> <FontAwesomeIcon icon={faTruck} className='i'/>  Service Livraison</h1></li>
                           <li> <h1 className='h1'>Message</h1></li>
                           <li><FontAwesomeIcon icon={faCartShopping} className='i'/> <h1 className='h1'>Votre achat</h1></li>
                           <li><div className='lig'></div></li>
                       </ul>
               </header>

    );
};

export default Navbar;
